import React from 'react';
import css from './Header.module.css';
import { Link } from 'react-router-dom';

export const Header = () => {
  return (
    <header className={css.header}>
      <div>
        <Link className={css.logo} to="/">
          My store
        </Link>
      </div>
      <div>Language goggle</div>
    </header>
  );
};
